import React, { Component } from 'react';
import { Container, Alert } from 'react-bootstrap'
class User extends Component {
    render() {
        console.log(this.props)
        return (
            <Container>
                <Alert className='h3' variant="primary">Thông tin tài khoản {this.props.match.params.user_id}</Alert>
            </Container>
        );
    }
}

export default User;
